'use strict';

var format = require('../../util/format');
var util = require('../../util/util');

module.exports = function($scope, $rootScope, $state, $http, $timeout, cfpLoadingBar, toastr) {


	/************ Callee ************/
  	if($scope.checkLoginStatus()){
  		
  		/************ Generic **********/

		$scope.admin = $rootScope.user ? angular.copy($rootScope.user) : angular.copy(format.admin);

		$rootScope.$watch('user',function(newValue,oldValue) {
            if(newValue){
              $scope.admin = angular.copy($rootScope.user);
            }
        }, true);

		var builder = new xml2js.Builder();
		var parseString = xml2js.parseString;

		var requestObj = angular.copy(format.requestObj);
	    var SmartEngineRequest = angular.copy(format.SmartEngineRequest);
	    var context = angular.copy(format.context);
	    requestObj.SmartEngineRequest = SmartEngineRequest;
	    SmartEngineRequest.Context = context;

		/*********** Date Config ***************/

		$scope.minDate = new Date(1980,1,1);
		$scope.maxDate = new Date();

		$scope.open = function($event) {
			$scope.status.opened = true;
		};

		$scope.dateOptions = {
			formatYear: 'yy',
			startingDay: 1
		};

		$scope.format = 'yyyy-MM-dd';

		$scope.status = {
			opened: false
		};


		/************* Functions **************/

		$scope.updateAdminProfile = function(){

			cfpLoadingBar.start();

			context.RequestType = "upsertAdmin";

			if($scope.admin.DOB instanceof Date){
				$scope.admin.DOB = util.formatDate($scope.admin.DOB);
			}

			SmartEngineRequest.AdminInfo = $scope.admin;

			var requestXML = builder.buildObject(requestObj);

			jms.jmsRequest(context.RequestType, requestXML,function(response){
				parseString(response, function (err, result) {
					$scope.result = result.SmartEngineResponse.Result.Status;
					cfpLoadingBar.complete();
					if($scope.result=='OK'){
						$scope.$apply(function(){
					 		$rootScope.user = angular.copy(result.SmartEngineResponse.AdminInfo);
						});

						if(util.getCookie('admin')){
					  		util.setCookie('admin', JSON.stringify($rootScope.user));
					  	}

					  	if(util.getLocalStorage('admin')){
					  		util.setLocalStorage('admin', JSON.stringify($rootScope.user));
					  	}

						toastr.success('Update Successful');	
					}
					else {
						toastr.error('Update Failed');
					}
					$scope.$apply(function(){
						$scope.admin = angular.copy($rootScope.user);
					});
				});
			});		

		};

		$scope.updateAdminEmail = function(){
			$scope.updateAdminProfile();
		};
	    
	    $scope.changeAdminPassword = function(administrator){
	    	
			if(administrator.password == administrator.rtpassword){
	    		$scope.admin.Password = administrator.password;
	    		$scope.updateAdminProfile();
		    }
		    else {
		    	toastr.error('Passwords do not match!');		
		    }

		    $scope.administrator = "";
	    };

  	};

};

