// var utility = require('../../util');
var format = require('../../util/format');
var util = require('../../util/util');

module.exports = function($scope, $rootScope, $state, $http, $timeout,$location, cfpLoadingBar, toastr) {

    /********** Callee *******************/
    if($scope.checkLoginStatus()){
       /********** Generic **********/
        
        $scope.hobbyChoices = angular.copy($scope.hobbyOptions);

        $scope.hobbies = [];

        $scope.hobby = angular.copy(format.hobby);

        if(!($rootScope.user.HobbyList instanceof Array)){
            var tmp = [];
            tmp.push($rootScope.user.HobbyList);
            $rootScope.user.HobbyList = angular.copy(tmp);
        }

        $rootScope.$watch('user',function (newValue,oldValue) {
            if(newValue){
                $scope.customer = angular.copy($rootScope.user);
                
                if($scope.customer.HobbyList) {

                    var hobbyList = [];

                    if($scope.customer.HobbyList instanceof Array){
                        hobbyList = angular.copy($scope.customer.HobbyList);
                    }
                    else {
                        var tmp = [];
                        tmp.push($scope.customer.HobbyList);
                        hobbyList = angular.copy(tmp);
                    } 

                    var generateSelectedHobbies = function(){

                        var tmp = [];

                        for(var i in hobbyList){
                            var hobbyItem = angular.copy(format.hobby);
                            hobbyItem.HobbyID = hobbyList[i].HobbyID;
                            for (var j in $scope.hobbyOptions) {
                                if(hobbyItem.HobbyID == $scope.hobbyOptions[j].HobbyID){
                                    hobbyItem.HobbyName = $scope.hobbyOptions[j].HobbyName;
                                    tmp.push(hobbyItem);
                                }
                            };
                        }

                        return tmp;
                    }

                    $scope.$watch('hobbyOptions',function (newValue,oldValue) {
                        
                        if(newValue.length){

                            $scope.hobbyChoices = angular.copy($scope.hobbyOptions);
                            $scope.hobbies = generateSelectedHobbies();
                        }
                    }, true);

                    $scope.$watch('locations',function (newValue,oldValue) {
                        
                        if(newValue.length){
                            var locationID = $rootScope.user.Location;
                            $scope.locationName = '';

                            for(var i in $scope.locations){
                                if(locationID == $scope.locations[i].LocationID){
                                    $scope.locationName = $scope.locations[i].LocationName;
                                }
                            } 
                            
                        }
                    },true);

                }     
            }
        }, true);



        $scope.$watch('hobbies', function(newValue,oldValue){

            $scope.hobbyChoices = angular.copy($scope.hobbyOptions);

            for(var i in $scope.hobbies){
                for(var j in $scope.hobbyChoices){
                    if($scope.hobbies[i].HobbyName == $scope.hobbyChoices[j].HobbyName){
                        $scope.hobbyChoices.splice(j,1);
                    }
                }
            }

        }, true);
        

        
        var builder = new xml2js.Builder();
        var parseString = xml2js.parseString;

        /*********** Date Config ***************/

        $scope.minDate = new Date(1980,1,1);
        $scope.maxDate = new Date();

        $scope.dateOptions = {
            formatYear: 'yy',
            startingDay: 1
        };

        $scope.format = 'yyyy-MM-dd';

        $scope.open = function(op) {
            switch(op){
                case 1:$scope.status.birthday = true;
                break;
                case 2:$scope.status.anniversary = true;
                break;
                default:break;
            }
        };

        $scope.status = {
            birthday: false,
            anniversary: false
        };



        /********** View Actions ***********/


        $scope.addHobby = function(index,hobby){
            if(hobby.HobbyName != "" ) {
                $scope.hobbies.push(angular.copy($scope.hobby));
                $scope.hobby = angular.copy(format.hobby);
            }

        };

        $scope.removeHobby = function(index){
                $scope.hobbies.splice(index,1);
                $scope.hobby = angular.copy(format.hobby);
        };

        
        /************* Functions **************/

        $scope.updateCustomerProfile = function(op){

            cfpLoadingBar.start();

            var requestObj = angular.copy(format.requestObj);
            var SmartEngineRequest = angular.copy(format.SmartEngineRequest);
            var context = angular.copy(format.context);
            requestObj.SmartEngineRequest = SmartEngineRequest;
            SmartEngineRequest.Context = context;

            context.RequestType = "upsertCustomer";

            if(!op)
                $scope.customer.HobbyList = angular.copy($scope.hobbies);

            if($scope.customer.Anniversary){
                if($scope.customer.Anniversary instanceof Date){
                    $scope.customer.Anniversary = util.formatDate($scope.customer.Anniversary);
                }
            }

            if($scope.customer.DOB){
                if($scope.customer.DOB instanceof Date){
                    $scope.customer.DOB = util.formatDate($scope.customer.DOB);
                }
            }

            SmartEngineRequest.CustomersInfo.CustomerDetails[0] = $scope.customer;

            var requestXML = builder.buildObject(requestObj);

            jms.jmsRequest(context.RequestType, requestXML,function(response){
                parseString(response, function (err, result) {
                    status = result.SmartEngineResponse.Result.Status;
                    cfpLoadingBar.complete();
                    if(status == "OK"){

                        $scope.$apply(function(){
                            result = angular.copy(result.SmartEngineResponse.CustomersInfo.CustomerDetails);
                            util.mapFormat(result,$rootScope.user);
                            toastr.success("Update Success");
                            $scope.getOffers();
                            // console
                        });

                        if(util.getCookie('customer')){
                            util.setCookie('customer', JSON.stringify($rootScope.user));
                        }

                        if(util.getLocalStorage('customer')){
                            util.setLocalStorage('customer', JSON.stringify($rootScope.user));
                        }
                    }
                    else {   
                        toastr.error("Update Failed");
                        $scope.$apply(function(){
                            $scope.customer = angular.copy($rootScope.user);
                            $scope.hobbies = [];
                        });
                    }

                    $scope.$apply(function(){
                        $scope.customer = angular.copy($rootScope.user);
                    });
                });
            });
        };

        $scope.updateCustomerEmail = function(){
            $scope.updateCustomerProfile(1);
        };

        $scope.updateCustomerPassword = function(cust){
            if(cust.password == cust.rtpassword){
                $scope.customer.Password = cust.password;
                $scope.updateCustomerProfile(1);
            }
            else { 
                toastr.error('Passwords do not match!');
            }
            $scope.cust = "";
        };


        switch($location.$$path){
            case '/customer/viewprofile':
                $scope.getAllLocations();
                $scope.getAllHobbies();
                break; 
            case '/customer/updateprofile':
                $scope.getAllLocations();
                $scope.getAllHobbies();
                break;
            default:break;
        }
    };
	
};

