'use strict';

module.exports = function($scope, $rootScope, $state, $http, $timeout, $uibModalInstance, items, selectedItems, selector) {

    /****************** Generic ***********************/

    $scope.generateCheckBits = function(selector, originalArray, selectedArray) {
        var resultArray = [];

        var locObj = {
            LocationID: '',
            LocationName: '',
            value: false
        };
        var hobbyObj = {
            HobbyID: '',
            HobbyName: '',
            value: false
        };

        switch (selector) {
            case 'Location':
            	for(var i in originalArray){
            		var obj = angular.copy(locObj);
            		obj.LocationID = originalArray[i].LocationID;
            		obj.LocationName = originalArray[i].LocationName;
            		for(var o in selectedArray){
            			if(obj.LocationID == selectedArray[o].LocationID){
            				obj.value = true;
            			}
            		}
            		resultArray.push(obj);	
            	}
                break;
            case 'Hobby':
            	for(var i in originalArray){
            		var obj = angular.copy(hobbyObj);
            		obj.HobbyID = originalArray[i].HobbyID;
            		obj.HobbyName = originalArray[i].HobbyName;
            		for(var o in selectedArray){
            			if(obj.HobbyID == selectedArray[o].HobbyID){
            				obj.value = true;
            			}
            		}
            		resultArray.push(obj);	
            	}
                break;
            default:
                break;
        }
        return resultArray;
    }

    $scope.selectedItems = selectedItems != undefined ? angular.copy(selectedItems) : [];

    $scope.items = $scope.generateCheckBits(selector,items, $scope.selectedItems);

    $scope.emptySelectionText = "No options selected. Select one or more options.";

    var exist = function(arrayObj,item,selectorField){
    	for(var o in arrayObj){
    		var tempObj = arrayObj[o];
    		if(tempObj[selectorField] == item){
    			return o;
    		}
    	}
    	return -1;
    }

    $scope.alterSelection = function(item) {
	
		var index = -1;
    	
    	if (selector == 'Location'){
    		index = exist($scope.selectedItems,item.LocationID,'LocationID');
    	}
        else {
        	index = exist($scope.selectedItems,item.HobbyID,'HobbyID');
        }

        if (item.value) {
            if (index == -1) {
                $scope.selectedItems.push(item);
            }
        } else {
            $scope.selectedItems.splice(index, 1);
        }
    }

    $scope.ok = function() {
        $uibModalInstance.close($scope.selectedItems);
    };

    $scope.cancel = function() {
        $uibModalInstance.dismiss('cancel');
    };


};

